import React from 'react';
import { Card } from 'antd';

const Userprofile = () =>{
  return (
    <Card
      actions={[
        <div key="instar">게시글</div>,
        <div key="followings">게시글</div>,
        <div key="followers">게시글</div>
      ]}
    >
      <Card.Meta
        avatar={<Avatar>JS</Avatar>}
        title="JS"
      />
    </Card>
  )
}

export default Userprofile;
